        [HttpGet, Route("api/patient/getPatientList")]
        public HttpResponseMessage getpatientlist(HttpRequestMessage request, int doctorid = 0,
            int scheduleid = 0, DateTime? appointmentDate = null, int page = 1, int pageSize = 10)
        {
            
            var result = (from appointment in dbContext.tbAppointments.Where(a => a.IsDeleted != true
                                                && a.DoctorId == doctorid && a.AppointmentDateTime == appointmentDate && a.Status != "CheckOut")
                                          join patient in dbContext.tbPatients.Where(a => a.IsDeleted != true)
                                          on appointment.PatientId equals patient.ID
                                          select new AppointmentViewModel
                                          {
                                              ID = appointment.ID,
                                              PatientId = appointment.PatientId,
                                              PatientName = appointment.PatientName,
                                              PatientAge = appointment.PatientAge,
                                              DoctorId = appointment.DoctorId,
                                              DoctorName = appointment.DoctorName,
                                              HospitalId = appointment.HospitalId,
                                              HospitalName = appointment.HospitalName,
                                              Status = appointment.Status,
                                              AppointmentDateTime = appointment.AppointmentDateTime,
                                              Counter = appointment.Counter,
                                              IsWaiting = appointment.IsWaiting,
                                              IsDeleted = appointment.IsDeleted,
                                              ScheduleID = appointment.ScheduleID,
                                              Day = appointment.Day,
                                              Accesstime = appointment.Accesstime,
                                              IsEmergency = appointment.IsEmergency,
                                              IsEmergencyApproved = appointment.IsEmergencyApproved,
                                              Problem = patient.Problem,
                                              BookingType = appointment.BookingType,
                                              IsCheckIn = appointment.IsCheckIn,
                                              IsDelByAdmin = appointment.IsDelByAdmin,
                                              ScheduleDataID = appointment.ScheduleDataID,
                                              IsApproved = appointment.IsApproved,
                                              SkipCount = appointment.SkipCount,
                                              Position = appointment.Position,
                                              CreatedTime = appointment.CreatedTime,
                                              Gender = patient.Gender
                                          });
            if (pageSize != 0)
            {
                PagedListServer<AppointmentViewModel> model = new PagedListServer<AppointmentViewModel>(result.OrderByDescending(a => a.Accesstime).OrderBy(a => a.IsEmergencyApproved), pageSize, page);
                dbContext.Dispose();
                return request.CreateResponse<PagedListServer<AppointmentViewModel>>(HttpStatusCode.OK, model);
            }
            else
            {
                var model = result.OrderByDescending(a => a.Accesstime).OrderBy(a => a.IsEmergencyApproved).ToList();
                dbContext.Dispose();
                return request.CreateResponse<List<AppointmentViewModel>>(HttpStatusCode.OK, model);
            }
        }

        [Route("api/patient/patientHistoryList")]
        [HttpGet]
        public HttpResponseMessage historylist(HttpRequestMessage request, int pagesize = 10, int page = 1,int doctorId=0, int hospitalId=0)
        {
            Expression<Func<tbAppointment, bool>> hospitalFilter = null;
            if(hospitalId > 0)
            {
                hospitalFilter = h => h.HospitalId == hospitalId;
            }else
            {
                hospitalFilter = h => h.IsDeleted != true;
            }

            IQueryable<tbAppointment> result = appointmentRepo.GetWithoutTracking().Where(a => a.IsDeleted != true 
                            && a.Status != "ACCEPTED" && a.Status != "CHECKIN" && a.Status != null && a.DoctorId == doctorId).Where(hospitalFilter);
            var totalCount = result.Count();
            var totalpages = (int)Math.Ceiling((double)totalCount / pagesize);
            var dataList = result.OrderBy(a => a.AppointmentDateTime)
                         .Skip(pagesize * (page - 1)).Take(pagesize);
            PagedListServer<tbAppointment> model = new PagedListServer<tbAppointment>();
            model.Results = dataList.ToList();
            model.TotalCount = totalCount;
            model.TotalPages = totalpages;
            dbContext.Dispose();
            return request.CreateResponse<PagedListServer<tbAppointment>>(HttpStatusCode.OK, model);
        }

      

